    var myAddSpan = function(contents) {
        var span = document.createElement("span");
        document.getElementById("console").appendChild(span); // insert it first so XHTML knows the namespace
        span.innerHTML = contents + '</br>';
    };

    var assert = function(value, msg) {
        if(value)
            myAddSpan('<span>' + escapeHTML(msg) + '<span class="pass">PASS</span> </span>');
        else
            myAddSpan('<span>' + escapeHTML(msg) + '<span class="fail">FAIL</span> </span>');
    };

    var FloatSizes = {
        F64: 0,
        F32: 1,
        F16: 2,
        F11: 3,
        F10: 4
    };

    var FloatSizeToSize = function(floatsize)
    {
        switch (floatsize){
            case FloatSizes.F64: return 64;
            case FloatSizes.F32: return 32;
            case FloatSizes.F16: return 16;
            case FloatSizes.F11: return 11;
            case FloatSizes.F10: return 10;
        }
    };

    var descs = new Array(Object.keys(FloatSizes).length);

    descs[FloatSizes.F64] = function() {return new framework.common.tcuFloat.FloatDescription(11, 52, 1023, framework.common.tcuFloat.FloatFlags.FLOAT_HAS_SIGN | framework.common.tcuFloat.FloatFlags.FLOAT_SUPPORT_DENORM);};
    descs[FloatSizes.F32] = function() {return new framework.common.tcuFloat.FloatDescription(8, 23, 127, framework.common.tcuFloat.FloatFlags.FLOAT_HAS_SIGN | framework.common.tcuFloat.FloatFlags.FLOAT_SUPPORT_DENORM);};
    descs[FloatSizes.F16] = function() {return new framework.common.tcuFloat.FloatDescription(5, 10, 15, framework.common.tcuFloat.FloatFlags.FLOAT_HAS_SIGN | framework.common.tcuFloat.FloatFlags.FLOAT_SUPPORT_DENORM);};
    descs[FloatSizes.F11] = function() {return new framework.common.tcuFloat.FloatDescription(5, 6, 15, 0);};
    descs[FloatSizes.F10] = function() {return new framework.common.tcuFloat.FloatDescription(5, 5, 15, 0);};

    var constructors = new Array(Object.keys(FloatSizes).length);

    constructors[FloatSizes.F64] = framework.common.tcuFloat.newFloat64;
    constructors[FloatSizes.F32] = framework.common.tcuFloat.newFloat32;
    constructors[FloatSizes.F16] = framework.common.tcuFloat.newFloat16;
    constructors[FloatSizes.F11] = framework.common.tcuFloat.newFloat11;
    constructors[FloatSizes.F10] = framework.common.tcuFloat.newFloat10;

    var testBySize = function(testcase, size)
    {
        var v = testcase.v;

        var strings = new Array(Object.keys(FloatSizes).length);
        strings[FloatSizes.F64] = testcase.v64;
        strings[FloatSizes.F32] = testcase.v32;
        strings[FloatSizes.F16] = testcase.v16;
        strings[FloatSizes.F11] = testcase.v11;
        strings[FloatSizes.F10] = testcase.v10;

        //Read the type from the 64-bit value using the constructor.
        var valueF = constructors[size](v);

        //Read each in it's own width type
        //var valueF = framework.common.tcuFloat.newDeFloatFromParameters(Number(strings[size]), descs[size]());
        
        debug(FloatSizeToSize(size) + '-BIT:\n');
        assert('0x' + valueF.bits().toString(16) == strings[size], '\tREADING TEST: ');
        debug('\t\tThe hex string is:                                   ' + strings[size]);
        debug('\t\tThe number obtained (as integer) from the string is: ' + Number(strings[size]));
        debug('\t\tThe number obtained (as integer) in hex is:          0x' + Number(strings[size]).toString(16));
        debug('\t\tThe converted hex is:                                0x' + valueF.bits().toString(16) + ', decimal ' + valueF.getValue());
        debug('\t\tThe computed sign is:                                0x' + valueF.signBit().toString(16) + ', decimal ' + valueF.signBit());
        debug('\t\tThe computed exponent is:                            0x' + valueF.exponentBits().toString(16) + ', decimal ' + valueF.exponentBits());
        debug('\t\tThe computed mantissa is:                            0x' + valueF.mantissaBits().toString(16) + ', decimal ' + valueF.mantissaBits());

        //Convert to each lower type.
        debug('\n\tCONVERSION TESTS:');
        for(var i=size+1; i < Object.keys(FloatSizes).length; i++)
        {
            var description = descs[i]();
            var convertedF = description.convert(valueF);

            assert('0x' + convertedF.bits().toString(16) == strings[i], '\t\tTo ' + FloatSizeToSize(i) + '-BIT: ');
            debug('\t\t\tThe hex string should be:                   ' + strings[i]);
            debug('\t\t\tThe converted hex is:                       0x' + convertedF.bits().toString(16) + ', decimal ' + convertedF.getValue());
            debug('\t\t\tThe converted sign is:                      0x' + convertedF.signBit().toString(16) + ', decimal ' + convertedF.signBit());
            debug('\t\t\tThe converted exponent is:                  0x' + convertedF.exponentBits().toString(16) + ', decimal ' + convertedF.exponentBits());
            debug('\t\t\tThe converted mantissa is:                  0x' + convertedF.mantissaBits().toString(16) + ', decimal ' + convertedF.mantissaBits());
        }
    };
    
    for(var i = 0 ; i < testvalues.length; i++)
    {
        var v = testvalues[i].v;

        debug('\nTEST CASE ' + i + ' BEGINS: ===============================================================================\n');
        debug('The javascript value read is:           ' + v);
        debug('The javascript hex representation is:   ' + v.toString(16));

        for(var j = 1; j < Object.keys(FloatSizes).length; j++)
        {
            testBySize(testvalues[i], j);
        }
    }
</script>
